# -*- coding: utf-8 -*-
from odoo import api, fields, models, modules
from odoo.exceptions import ValidationError


GIF = b''

class Partner(models.Model):
	_inherit = "res.partner"
	_description = 'Contact'

	duns_number = fields.Integer('DUNS number')
	commodity_id = fields.Many2many("commodity.type", string='Commodity Type')
	financial_rating = fields.Selection([
		('a', 'A'),
		('b', 'B'),
		('c', 'C'),
		('d', 'D'),
		('e', 'E'),
	], string="Financial Rating",)
	is_mail_send = fields.Boolean()
	is_nda_signed = fields.Boolean(string='Is NDA signed')
	financial_rating = fields.Selection([('a', 'A'),('b', 'B')], string="Financial Rating")
	is_mail_send = fields.Boolean('Mail Sent?')
	nda = fields.Binary('NDA')

	def send_nda(self):
		if self.is_mail_send == False:
			attachment = self.env['ir.attachment'].create({'name':'nda.pdf',
														'type': 'binary',
														'store_fname': 'nda.pdf',
														'datas': GIF})
			template_id = self.env.ref('custom_contacts.email_template_for_nda')   
			template_id.attachment_ids = [(6,0,[attachment.id])]             
			template_id.send_mail(self.id, force_send=True)
			self.write({'is_mail_send':True})